import React, { useEffect, useState } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  Container,
  Grid,
} from "@mui/material";
import { useNavigate } from "react-router-dom";

const brandLogos = [
  { name: "HONDA", src: "/logos/honda.png" },
  { name: "JAGUAR", src: "/logos/jaguar.png" },
  { name: "NISSAN", src: "/logos/nissan.png" },
  { name: "VOLVO", src: "/logos/volvo.png" },
  { name: "AUDI", src: "/logos/audi.png" },
];

const HomePage = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);

  useEffect(() => {
    const sessionUser = sessionStorage.getItem("user");
    if (sessionUser) {
      const parsedUser = JSON.parse(sessionUser);
      setUser(parsedUser);
      console.log("Giri≈ü yapmƒ±≈ü kullanƒ±cƒ±:", parsedUser);
    }
  }, []);

  return (
    <>


      {/* Hero Section */}
      <Container maxWidth="xl" sx={{ mt: 8, mb: 6 }}>
        <Grid container spacing={4} alignItems="center">
          {/* Sol metin */}
          <Grid item xs={12} md={6}>
            <Typography variant="h3" fontWeight="bold" gutterBottom>
              üîç Find, compare and choose the best car for you
            </Typography>
            <Typography variant="h4" color="text.secondary" sx={{ mb: 4 }}>
              Easily and confidently
            </Typography>
            <Button
              variant="contained"
              sx={{
                backgroundColor: "#5c2e2e",
                paddingX: 4,
                paddingY: 1.5,
                fontSize: "1.1rem",
              }}
              onClick={() => navigate("/carlistpage")}
            >
              Compare Now
            </Button>
          </Grid>

          {/* Saƒü resimler */}
          <Grid item xs={12} md={6}>
            <Box
              sx={{
                display: "flex",
                flexDirection: "column",
                gap: 4,
                alignItems: "center",
              }}
            >
              <img
                src="/logos/v107_20.png"
                alt="Lamborghini"
                style={{ width: "100%", maxWidth: 500, objectFit: "contain" }}
              />
              <img
                src="/logos/v105_475.png"
                alt="Audi"
                style={{ width: "100%", maxWidth: 500, objectFit: "contain" }}
              />
            </Box>
          </Grid>
        </Grid>
      </Container>

      {/* Marka logolarƒ± */}
      <Box
        sx={{
          display: "flex",
          justifyContent: "space-around",
          alignItems: "center",
          flexWrap: "wrap",
          gap: 3,
          px: 6,
          pb: 6,
        }}
      >
        {brandLogos.map((brand) => (
          <img
            key={brand.name}
            src={brand.src}
            alt={brand.name}
            style={{
              height: 40,
              objectFit: "contain",
              marginInline: 8,
            }}
          />
        ))}
      </Box>
    </>
  );
};

export default HomePage;
